import Professional from './Components/Professional';

import {BrowserRouter, Routes, Route} from 'react-router-dom'

import './App.css';

function App() {
  return (
    <div className="App">

    <BrowserRouter>
    <Routes>
      <Route path='/professional' element={<Professional></Professional>}></Route>

    </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
